INSERT INTO `equipment` VALUES (1,'Baking dish','Used for baking casseroles, lasagna, and other oven-baked dishes. Grease before use to prevent sticking.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(2,'Baking sheet','Ideal for baking cookies, roasting vegetables, and making sheet pan dinners. Line with parchment paper for easy cleanup.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(3,'Blender or food processor','Use to blend, puree, or emulsify ingredients. Ensure the lid is secure before starting.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(4,'Box grater','Grate cheese, vegetables, and fruits. Use the appropriate side for the desired grate size.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(5,'Chef\'s knife','Use for chopping, slicing, and dicing fruits, vegetables, and meats. Keep the blade sharp for best results.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(6,'Colander','Rinse and drain pasta, vegetables, and fruits. Place in the sink to drain water efficiently.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(7,'Cutting board','Protects your countertop while cutting. Use separate boards for raw meat and produce to avoid cross-contamination.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(8,'Deep skillet or frying pan','Perfect for frying, sauting, and browning. Use a non-stick spray or oil to prevent food from sticking.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(9,'Garlic press','Crush garlic cloves quickly and efficiently. Place peeled or unpeeled clove in the press and squeeze.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(10,'Kitchen scale','Measure ingredients by weight for precise cooking and baking. Tare the scale with an empty container before adding ingredients.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(11,'Large mixing bowl','Use for mixing ingredients, marinating meats, or preparing salads. Choose a size appropriate for your recipe.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(12,'Large pot','Boil pasta, make soups, or cook large batches of food. Ensure it has a lid to control evaporation.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(13,'Measuring cups','Measure dry and liquid ingredients accurately. Use dry cups for solids and liquid cups for liquids.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(14,'Measuring spoons','Measure small quantities of ingredients, both dry and liquid. Level off dry ingredients for accuracy.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(15,'Microplane or zester','Zest citrus fruits or finely grate hard cheeses and spices. Use light pressure to avoid cutting too deeply.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(16,'Mixing spoons','Stir and mix ingredients in bowls or pots. Use wooden or silicone spoons to avoid scratching non-stick surfaces.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(17,'Oven','Bake, roast, and broil a variety of dishes. Preheat to the required temperature before placing food inside.','https://media.istockphoto.com/id/881670884/photo/kitchen-utensils-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=VRwC_MfobWNXP8ElA76hHuzH3QT663W4pIOp6GFsk1U=','Dough yeah! This gadget makes baking a breeze.'),(18,'Pastry brush','Apply egg wash, butter, or glazes to pastries and doughs. Clean thoroughly after each 